import React, {useState, useEffect} from 'react';
import axios from 'axios';
import './App.css';
function FetchUser() {
    const [posts, setPosts] = useState([])
    const fetchUrl = 'https://api.spaceXdata.com/v3/launches?limit=100';
    useEffect(() => {
        axios.get(fetchUrl)
        .then(res => {
            console.log(res)
            setPosts(res.data)
        })
        .catch(err =>{
             console.log(err)
        })
    },[fetchUrl])

   return (
    <div className="wrapper">
    <h1>SpaceX Launch Programs</h1>
    <h2>filters</h2>
  
    <h2 className="launch-year">Launch Year</h2>
    <hr/>
 {
    posts.map((item, index) => {
       
        return (
            <div>
            <div className="left-div"> 
            <ul>
             <li className="li-list" key={index}>{item.launch_year}</li>
            </ul>  
            </div>
            <section className="right-section">
               <div className="right-div">
               <img  alt={item.mission_name} src={item.links.mission_patch_small}/>
               <h3>{item.mission_name}</h3>
                <h3>{item.mission_id}</h3>
                <h3>{item.launch_year}</h3>
                <h3>successful launch : {item.launch_success}</h3>
                <h3>successful landing :{item.is_tentative}</h3>
                </div> 
            </section>
           </div>       
        )
    })
}
      </div>

   )
}

export default FetchUser
